const dashcontainerStyle = theme => ({
    container: {
        display: "flex",
        flexWrap: "wrap",
        flexDirection: "column",
        justifyContent: "flex-start",
        width: "100%"
    },
    accordion: {
        width: "90%"
    },
    typo: {
        height: "fit-content",
        width: "inherit",
        paddingTop: "2rem",
        paddingLeft: "2rem",
        paddingBottom: "1rem"
    },
    column: {
        flexBasis: "33.3%",
        display: "flex",
        justifyContent: "flex-start",
        paddingLeft: "1rem"
    },
    secondaryHeading: {
        color: theme.palette.text.secondary,
    },
    tableitem:{
        textTransform: "capitalize",
        fontSize: "2rem"
    }
})

export default dashcontainerStyle;
